import React from 'react';
import City from './City.js';
import data from '../assets/json/data.js';

class SecondContent extends React.Component {
    createTable() {
        for(var i = 0; i < data.length; i++) {
            data[i].used = false;
        }
        return this.getRandomCities();
    }

    getRandomCities() {
        var table = [];
        var index = 0;

        do {
            var city = this.getRandomCity();

            if (!city.used) {
                table.push(
                    <li key={index}>
                        <City src={city.image} name={city.name} />
                    </li>
                );
                city.used = true;
            }
            index++;
        } while (index <= 1);
        return table;
    }

    getRandomCity() {
        const current = data[Math.floor(Math.random() * data.length)];
        return current;
    }

    render() {
        return (
            <div className="content2">
                <h5 className="city_header">Popular MYtineraries</h5>
                <ul className="cities">
                    {this.createTable()}
                </ul>
            </div>
        );
    }
}

export default SecondContent;
